import { 
    ImageBackground,
    View,
    Text
} from "react-native";
import styled from "styled-components/native"

export const SubmittedTxt = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 900;
font-size: 30px;
line-height: 35px;
text-align: center;
color: #FFFFFF;
margin-top: 12px;
`
